UpdateCSSCompactifications::usage="UpdateCSSCompactifications[]

Updates the package if there is a new version. Internet connection required.";


$CSSVersion::usage="Returns the current version number.";


Begin["`Private`"];


$CSSVersion:= 1.0; (*Keep the space*)
updateaddress="https://raw.githubusercontent.com/zkbaykara/CSSCompactifications/main/CSSCompactifications.m";


UpdateCSSCompactifications[]:=If[$CSSVersion<
ToExpression@StringTake[Import[updateaddress,"String"],
{StringPosition[Import[updateaddress,"String"],"$CSSVersion:="][[1,2]]+1,
StringPosition[Import[updateaddress,"String"],"$CSSVersion:="][[1,2]]+4}],
Print["Updating from v",DecimalForm[$CSSVersion,{3,1}]," to v",
DecimalForm[ToExpression@StringTake[Import[updateaddress,"String"],
{StringPosition[Import[updateaddress,"String"],"$CSSVersion:="][[1,2]]+1,
StringPosition[Import[updateaddress,"String"],"$CSSVersion:="][[1,2]]+4}],{3,1}],"..."];
If[Check[CopyFile[URL["https://raw.githubusercontent.com/zkbaykara/CSSCompactifications/main/CSSCompactifications.m"],
FileNameJoin[{$UserBaseDirectory,"Applications/CSSCompactifications.m"}],OverwriteTarget->True];True,False],
Print["Successfully updated. Please reload the CSS package with the usual command: <<CSSCompactifications`."],
Print["Update was unsuccessful. Please see associated error messages."]]
,
Print["Your version (v",$CSSVersion,") is up to date."]];


